function mkFormDesign(opts) {

// var aiStr = ... ai CC version file with "designer form" FlexoPrint workflow
  eval('@JSXBIN@ES@2.0@');

  var aiFile;
  var fileName = opts.order_number + '_' + opts.order_title;
  var filePath = opts.filePath || Folder.temp;
  // if(filePath == '') filePath = Folder.temp;


  if (fileName != '_') {
    if(!(new Folder (filePath + '/kd/').exists)) new Folder (filePath + '/kd/').create();
    aiFile = new File(filePath + '/kd/' + fileName.replace(/"/gmi, '') + '.ai');
  } else {
    aiFile = new File(filePath + "/fp-form-designer_" + _randStr(6) + "_.ai");
  }

  aiFile.encoding = 'BINARY';
  aiFile.open('e');
  aiFile.write(aiStr);
  aiFile.close();
  aiFile.execute();

  /**
   * random string generator
   *
   * @param {Number} n - required sting length; 1 <= n <= 17; default value is 8
   * @return {String} str - random n-characters string
   * */
  function _randStr(numb) {
    var n = numb;

    if (isNaN(parseFloat(n)) || !isFinite(n)) n = 8;
    if (!arguments.length) n = 8;
    if (n > 17) n = 17;
    if (n < 1) n = 1;

    var str = ((+new Date()) * Math.random() *
      1e7 + // shift (delete) decimal point
      new Array(n).join('0') // for the case when random number is 0
    ).slice(0, n);

    return str;
  }

}


